import React, { useState } from 'react';

function Search () {
    const [exerciseFilter, setExerciseFilter] = useState('')

    function handleExerciseFilter(e){
        e.preventDefault()
        setExerciseFilter(e.target.value)
    }
    return(
        <div>
            <h3>Search</h3>
            <form className="search-form">
                <legend>Search</legend>
                <input type="text" value={exerciseFilter} onChange={handleExerciseFilter} placeholder="ex. Bench Press"/>
            </form>
        </div>
    )
}

export default Search;

